import React from "react";
import Heading from "./Heading";
import skills_icon from  '../Assets/skills.png';
import TechnicalSkillsItems from './TechnicalSkillsItems'
import '../Styles/TechnicalSkills.css'

const TechnicalSkills = () => {
    const skills = ["iOS", "Swift", "Javascript", "ReactJS", "Andriod", "HTML", "CSS", "Bootstrap", "C#", "C", "C++", "Python",
     "IoT", "Git", "Core JAVA", "Jenkins", "Jira", "MVVM", "MVC", "Agile", "Xcode", "Android Studio", "Data Structures",
    "GraphQL", "Power BI"]
    return(
        <div className="technical-skills-container">
            <Heading heading = "Technical Skills, Tools & Technologies" icon = {skills_icon}/>
            {
                skills.map(skill => <TechnicalSkillsItems skill = {skill}/>)
            }

        </div>
    )
}

export default TechnicalSkills;
